css:
.git-control .dialog {
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  min-width: 50%;
  background: #403e3a;
  border: 1px solid rgba(32, 31, 29, 0.85);
  border-radius: 4px;
  padding: 15px;
  opacity: 0.95;
  display: none;
  z-index: 10;
}
.git-control .dialog.active {
  display: block;
}
.git-control .dialog .body {
  margin-bottom: 15px;
}
.git-control .dialog .heading {
  margin-bottom: 15px;
}
.git-control .dialog .heading strong {
  color: #dddcda;
  display: inline-block;
}
.git-control .dialog .heading i.icon {
  float: right;
  width: 0;
  margin-right: 15px;
}
.git-control .dialog input,
.git-control .dialog select,
.git-control .dialog textarea {
  width: 100%;
  margin-bottom: 15px;
  background: #252422;
  border-color: #201f1d;
  border-radius: 4px;
  color: #adaaa4;
  padding: 10px;
}
.git-control .dialog .checkbox {
  width: 5%;
  display: inline;
  vertical-align: -30%;
}
.git-control .dialog input[readonly],
.git-control .dialog textarea[readonly],
.git-control .dialog select[readonly] {
  color: rgba(173, 170, 164, 0.6);
}
.git-control .dialog select {
  -webkit-appearance: none;
  -moz-appearance: none;
  appearance: none;
}
.git-control .dialog textarea {
  height: 150px;
  resize: none;
}
.git-control .dialog textarea.over-fifty {
  color: #ff6347;
}
.git-control .dialog .warningText {
  color: #e2c08d;
}
.git-control .dialog .warningText:hover {
  color: #ff6347;
}
.git-control .dialog button {
  background: transparent;
  border: 1px solid transparent;
  border-radius: 4px;
  color: #adaaa4;
  margin-right: 10px;
}
.git-control .dialog button:hover {
  color: #dddcda;
}
